import './App.css';
import FloatingNavBar from './FloatingNavBar';
import Header from './header';
import Footer from './footer';
import image4 from './Elements/family.jpg'


function App() {
  return (
    <div className="App bg-gradient-to-r from-teal-400 to-teal-600 w-max h-max">
      <Header/>
      <FloatingNavBar/>
      <Footer/>
    </div>
  );
}

export default App;
